import React from 'react';
import cls from '../savdo.module.scss'
import UsdtTemp from "../usdt-temp";

const SavdoBoshlash = () => {
    return (
        <div className={cls.savdo}>
            <div className="container" style={{padding: '0'}}>
                <div className={cls.inner}>
                    <UsdtTemp />
                </div>
            </div>
        </div>
    );
};

export default SavdoBoshlash;
